import React from 'react'
import FooterSection from '../sections/FooterSection'
import MainMenuSection from '../sections/MainMenuSection'

function NotFoundView() {
  return (
    <>
       <MainMenuSection />
      <FooterSection />

     <h1>404 - Page Not Found</h1>
    </>
  )
}

export default NotFoundView
